import React from "react";

function SearchBar({ searchQuery, onSearchChange }) {
  return (
    <div>
      <input
        type="text"
        placeholder="Search doctors"
        value={searchQuery}
        onChange={onSearchChange}
        className="form-control mb-4"
        data-testid="autocomplete-input"
      />
    </div>
  );
}

export default SearchBar;
